using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIImageAsset_Ref/index.html#//apple_ref/occ/cl/UIImageAsset	/// <summary>	/// A UIImageAsset object is a container for a collection of images that represent a single piece of artwork that has multiple ways to describe it. A common case for this is to group multiple images of the same item at different display scales.	/// </summary>	[iOSVersion(8)]	public class UIImageAsset : NSObject	{		/// <summary>		/// Associates an image with a particular trait collection.		/// </summary>		/// <param name="image">The image to be registered.</param>		/// <param name="withTraitCollection">The trait collection that the image is registered with.</param>		[iOSVersion(8)]		[Export("registerImage")]		public void RegisterImage(UIImage image, UITraitCollection withTraitCollection) { }				/// <summary>		/// Removes the image associated with the trait collection from an image asset.		/// </summary>		/// <param name="traitCollection">The trait collection that is searched for.</param>		[iOSVersion(8)]		[Export("unregisterImageWithTraitCollection")]		public void UnregisterImageWithTraitCollection(UITraitCollection traitCollection) { }				/// <summary>		/// Returns the image that is registered with a specified trait collection.		/// </summary>		/// <param name="traitCollection">The trait collection to be searched for.</param>		/// <returns>The found image.</returns>		[iOSVersion(8)]		[Export("imageWithTraitCollection")]		public UIImage ImageWithTraitCollection(UITraitCollection traitCollection) { return null; }	}}